import * as types from './types';

export const loadUserStart = () => ({
    type: types.LOAD_USER_START,
})

export const loadUserSuccess = (users) => ({
    type: types.LOAD_USER_SUCCESS,
    payload: users
})

export const loadUserFailed = (err) => ({
    type: types.LOAD_USER_FAILED,
    payload: err
})
